import React from 'react';
import './index.css';
import Card from './Card';

function App() {
    return (
        <>
            <div class="row">
                <div class="col-md-4">
                    <Card />
                </div>

                <div class="col-md-4">
                    <Card />
                </div>

                <div class="col-md-4">
                    <Card />
                </div>

                <div class="col-md-4">
                    <Card />
                </div>

                <div class="col-md-4">
                    <Card />
                </div>
            </div>
        </>
    );
}

export default App;
